	"nome" : "PLASMA CITRATADO CONGELADO",
	"descricao" : "O plasma citratado congelado é um componente sanguíneo que é obtido a partir do plasma sanguíneo de um doador. É chamado de 'citratado' porque contém citrato de sódio, que é um anticoagulante que impede a coagulação do plasma. O citrato é adicionado durante a coleta do sangue para evitar que o sangue se coagule e permitir que o plasma seja separado das células sanguíneas. Depois que o plasma é separado, ele pode ser congelado para preservar suas propriedades e componentes por um período prolongado. O plasma citratado congelado é frequentemente utilizado para várias finalidades médicas, incluindo: Transfusões de componentes sanguíneos: O plasma pode ser transfundido a pacientes que precisam de fatores de coagulação específicos, como em casos de distúrbios de coagulação ou cirurgias. Produção de hemoderivados: O plasma é uma matéria-prima importante na produção de diversos produtos de terapia plasmática, como o fator de coagulação e a albumina. Pesquisa médica: O plasma é frequentemente usado em estudos e pesquisas médicas para entender melhor as propriedades do sangue e desenvolver tratamentos médicos. É importante notar que o plasma citratado congelado é armazenado em condições controladas e deve ser manipulado e transportado de forma adequada para preservar sua qualidade e garantir sua segurança para uso médico. Além disso, a doação de plasma é uma parte importante da doação de sangue e ajuda a salvar vidas em várias situações clínicas."
}
